Specify an override for all packages that override the Rust toolchain used. This can be done like so: { # ... packageOverrides = { # ... "^.*".set-toolchain.overrideRustToolchain = old: { inherit (pkgs) cargo rustc; }; # ... }; # ...
} You can also of course override the toolchain for only certain crates: { # ... packageOverrides = { # ... crate-name.set-toolchain.overrideRustToolchain = old: { inherit (pkgs) cargo rustc; }; # ... }; # ...
} crane notes The crane builder does not require a rustc package in the toolchain specified, only a cargo package is needed. If cross-compiling, keep in mind that it also takes cargo packages like so: { cargoHostTarget = cargo-package; cargoBuildBuild = other-cargo-package;
} where cargoHostTarget has the same meaning as coming from a pkgsHostTarget. And cargoBuildBuild has the same meaning as coming from a pkgsBuildBuild. To override the toolchain for a specific package, you will need to set an override for both the dependencies and the main package derivation: let toolchainOverride = old: { /* ... */ };
in
{ # ... packageOverrides = { # ... crate-name.set-toolchain.overrideRustToolchain = toolchainOverride; crate-name-deps.set-toolchain.overrideRustToolchain = toolchainOverride; # ... }; # ...
} Examples Usage with fenix : let # ... # we use the full toolchain derivation here as using # only the cargo / rustc derivation *does not* work. toolchain = fenix.packages.${system}.minimal.toolchain; # ...
in
{ # ... packageOverrides = { # for crane builder "^.*".set-toolchain.overrideRustToolchain = old: {cargo = toolchain}; # for build-rust-package builder "^.*".set-toolchain.overrideRustToolchain = old: { cargo = toolchain; rustc = toolchain; }; }; # ...
} Usage with oxalica's rust-overlay : let # ... toolchain = rust-overlay.packages.${system}.rust; # ...
in
{ # ... packageOverrides = { # for crane builder "^.*".set-toolchain.overrideRustToolchain = old: {cargo = toolchain}; # for build-rust-package builder "^.*".set-toolchain.overrideRustToolchain = old: { cargo = toolchain; rustc = toolchain; }; }; # ...
}

